/*  The program SuSpect: calculating the MSSM (or related models) Spectrum */

/*  ++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++ */
/*  Authors: Abdelhak Djouadi, Jean-Loc Kneur and Gilbert Moultaka */
/*  (main coding and maintenance: J-L Kneur) */
/*              (LPTA, CNRS & Universite de Montpellier II). */
/*  VERSION 2.41 */
