/*  The reference to be used for the program is: hep-ph/0211331 */
/*                 (published in Comput. Phys. Commun. 176:426) */
/*  ++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++ */
/*  This code calculates the supersymmetric + Higgs particle spectrum in the */
/*  unconstrained Minimal Supersymmetric Standard Model (MSSM), as well as */
/*  constrained models such as the minimal Supergravity (mSUGRA), the */
/*  gauge mediated SUSY (GMSB) and anomaly mediated SUSY (AMSB) breaking */
