    pizzhs = -(d__1 * d__1) * (z__1.r + z__2.r - d__2 * d__2 * z__3.r) - d__3 
	    * d__3 * (z__4.r + z__5.r - d__4 * d__4 * z__6.r) - d__5 * d__5 * 
	    z__7.r - pizzh0;

/* Computing 2nd power */
    d__2 = cos(su_bpew__3.thet);
/* Computing 2nd power */
    d__3 = sin(su_bpew__3.thet);
/* Computing 2nd power */
    d__1 = (.5 - sw2 * 2 / 3) * (d__2 * d__2) - sw2 * 2 / 3 * (d__3 * d__3);
    su_bt22__(&z__1, &qsz, &su_bpew__3.mst1, &su_bpew__3.mst1);
/* Computing 2nd power */
    d__5 = sin(su_bpew__3.thet);
/* Computing 2nd power */
    d__6 = cos(su_bpew__3.thet);
/* Computing 2nd power */
    d__4 = -(.5 - sw2 * 2 / 3) * (d__5 * d__5) + sw2 * 2 / 3 * (d__6 * d__6);
    su_bt22__(&z__2, &qsz, &su_bpew__3.mst2, &su_bpew__3.mst2);
/* Computing 2nd power */
    d__7 = sin(su_bpew__3.thet) * .5 * cos(su_bpew__3.thet);
    su_bt22__(&z__3, &qsz, &su_bpew__3.mst1, &su_bpew__3.mst2);
/* Computing 2nd power */
