    su_bt22__(&z__4, &qsz, &su_bpew__3.msu1, &su_bpew__3.msu1);
/* Computing 2nd power */
    d__9 = sw2 * 2 / 3;
    su_bt22__(&z__5, &qsz, &su_bpew__3.msu2, &su_bpew__3.msu2);
