	    d__7 * 24 * z__3.r - d__8 * d__8 * 24 * z__4.r - d__9 * d__9 * 24 
	    * z__5.r;

/* Computing 2nd power */
    d__2 = cos(su_bpew__3.theb);
/* Computing 2nd power */
    d__3 = sin(su_bpew__3.theb);
/* Computing 2nd power */
    d__1 = (sw2 / 3 - .5) * (d__2 * d__2) - -sw2 / 3 * (d__3 * d__3);
    su_bt22__(&z__1, &qsz, &su_bpew__3.msb1, &su_bpew__3.msb1);
/* Computing 2nd power */
    d__5 = sin(su_bpew__3.theb);
/* Computing 2nd power */
    d__6 = cos(su_bpew__3.theb);
/* Computing 2nd power */
    d__4 = -(sw2 / 3 - .5) * (d__5 * d__5) + -sw2 / 3 * (d__6 * d__6);
    su_bt22__(&z__2, &qsz, &su_bpew__3.msb2, &su_bpew__3.msb2);
