    static integer nstp;
    static doublereal yscal[31], hnext;

/*  ++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++ */
/* This is the main subroutine (from Numerical Recipes) integrating */
/* (coupled) Ordinary Differential Equation */

    /* Parameter adjustments */
    --ystart;

    /* Function Body */
    x = *x1;
    d__1 = *x2 - *x1;
    h__ = d_sign(h1, &d__1);
