    strsfuncs_(mg, t1, t2, q, &a, &sf2, &sf3);
    strdfuncs_(t, mg, t1, t2, &s2t, &c2t, q, &a, &x, &df1, &df2, &df3, &dsf2, 
	    &dsf3);
