	d__1 = ht;
	*s12 = d__1 * d__1 * mt * *mu * (f2_s__ + osdr * df2);
/* Computing 2nd power */
	d__1 = ht;
/* Computing 2nd power */
	d__2 = mt;
/* Computing 2nd power */
	d__3 = ht;
	*s22 = d__1 * d__1 * 2. * (d__2 * d__2) * (f1 + osdr * df1) + d__3 * 
		d__3 * 2. * mt * a * (f2_s__ + osdr * df2);
